"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    T4 replacement increases cardiac contractility",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 322px; height: 442px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of L-thyroxine replacement in patients with hypothyroidism on serum T4, TSH, and cardiac contractility as measured by the pre-ejection period (PEP) as a function of ejection time (LVET). Contractility increased (as demonstrated by a fall in PEP/LVET) in a dose-dependent fashion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Crowley WF Jr, Ridgway EC, Bough EW, et al. Noninvasive evaluation of cardiac function in hypothyroidism. Response to gradual thyroxine replacement. N Engl J Med 1977; 296:1.",
